import styles from './QuestionCategoryList.module.css'

const QuestionCategoryList = ({ title, show, visibility, questions, categories }) => {
    return (
        <div className={styles.tile} onClick={show}>
            <ul>
                {categories.map(category => <li>
                    {title}
                </li>)}

                {/* <QuestionItem visibility={visibility} questions={questions} /> */}
            </ul>
        </div>
    )
}

export default QuestionCategoryList
